import { SparklesIcon } from '@heroicons/react/24/solid'
import React from "react";
//import { projects } from "../data";

export default function History() {
  return (
    <section id="history" className="text-gray-400 bg-gray-900 body-font">
      <div className="container px-5 py-10 mx-auto text-center lg:px-40">
        <div className="flex flex-col w-full mb-20">
        <SparklesIcon className="mx-auto inline-block w-10 mb-4" />
          <h1 className="sm:text-4xl text-3xl font-medium title-font mb-4 text-white">
            ABOUT ME
          </h1>
          <p className="lg:w-2/3 mx-auto leading-relaxed text-base">
          Iâ€™m currently a student at the University of North Texas. My major is computer science and my graduation date is December, 2024. I love learning and challenging myself and finding ways to build upon new and old skills. I really enjoy building something out of nothing and exploring creativity when thinking up fun app ideas or coding a simple program. I hope to be able to develop my skills professionally and contribute to a team and learn from others!
          </p>
        </div>
      </div>
    </section>
  );
}
